void dsp::test::lattice_test::test_fir()
{
	float out[1024];
	dsp::lattice_fir<float> fir(k, 3);
	for (size_t i = 0; i < 1024; ++i) out[i] = fir(x[i]);
	CPPUNIT_ASSERT(std::equal(out, out + 1024, ref_fir, dsp::within_range<float>(0.00001f)));
}

void dsp::test::lattice_test::test_iir()
{
	float out[1024];
	dsp::lattice_iir<float> iir(k, 3);
	for (size_t i = 0; i < 1024; ++i) out[i] = iir(x[i]);
	CPPUNIT_ASSERT(std::equal(out, out + 1024, ref_iir, dsp::within_range<float>(0.00001f)));
}

void dsp::test::lattice_test::test_lattice_ladder()
{
	float out[1024];
	dsp::lattice_ladder<float> latldr(k, 3, k, 3);

	for (size_t i = 0; i < 1024; ++i) out[i] = latldr(x[i]);
	CPPUNIT_ASSERT(std::equal(out, out + 1024, ref_latlad, dsp::within_range<float>(0.00001f)));
}
